import React from "react";
import './index.css';

function HPNavBar(){
    return(
        <div className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li>Virtual Version</li>
                <li className="nvUpperRightOptions"><a><button>Log in</button></a></li>
                <li className="nvUpperRightOptions"><a><button>Sign up</button></a></li>
            </ul>
        </div>
    );
}

export default HPNavBar;
